    "name": "Ram",
    "address":{
        "village":"Royana",
        "City":"Nashik",
        "State":"Maharashtra"
    },
    "social":["twitter ", "linkedin ", "facebook ", "instagram "]
}
function profile(){
    console.log(person.social[0])
}
export default function LearinngJavaScript(){
    return(
        <>
        <div>{person.name}</div>
        <div>{person.address.City}</div>
        <div>{person.social}</div>
        <div>{profile}</div>
        </>
    )
}
